	('0zMl1VZVvhN5zfhyO6PGI2','44515','','',1,NULL,0,'2022-06-24 12:00:00','2022-12-31 23:59:59','4,720円（税込）※定期コース限定価格',20.86,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,'話題のまつ毛美容液「リバイブラッシュ」がリニューアルして登場！\n多くの雑誌にも取り上げられて\n今、20～40代の大人女性に売れています！！\n品質にこだわっているからこそ60日間でご満足できなければ、【全額返金保証】いたします。\n    ※初回のお申込みに限ります。商品到着後60日以内にご連絡ください。\n    ※返品の際の送料はご負担ください。商品の容器が揃わない場合は返金できません。\n    ※複数購入の場合は、60日以内であっても2本目を開封した時点で返金対象外となります。\n１本購入のための定期コースもあります（https://www.revivelash.com/revivelash-teiki.html）','https://stat.amebaad.jp/ad/specialselect/amebapick/todo.png',2,'過去このサービス（商品）を利用したことがありますか？\nはい/いいえで教えてください。（※過去に利用したことがある場合でも、申込みが可能です。）','生える・まつ育・育毛　等のワードはNG。','・ご自身で撮影した写真を、1枚以上ブログに掲載してください。\n・商品やサービスについての感想や紹介を、最低3文以上を目安に掲載してください。\n・ハッシュタグに、必ず「#PR」をつけて投稿してください。\n・Ameba Pickのお知らせに発送通知が届いてから3週間以内に投稿を行ってください。\n・投稿した記事は、最低1年以上公開し、記事の削除はお控えください。\n\n※上記が守られない場合、報酬が反映されない、今後のスペシャルセレクト利用をお断りさせていただく場合がございます。','まつ毛のキレイを育てる、新発想まつ毛美容液',1,'【オープン】まつ毛美容液「リバイブラッシュ」_202206','2022-06-23 18:24:10','oidc|Perman|S13797','2022-06-24 17:48:02','oidc|Perman|S13797'),
	('1pvwsLfDxcqc7eyAUEdtn5','45401','','',1,NULL,0,'2022-06-24 12:00:00','2022-12-31 23:59:59','1,800円（税込）※初回限定',NULL,2125,NULL,NULL,4900,'2022-12-31 23:59:59','2022-12-31 23:59:59',0,NULL,0,'＜製品特徴＞ \nシミ・くすみ※1、つくらせない！うるつや透明美白へ※2\n美白ニーズが高まる4月～9月はもちろん、乾燥が気になる秋から冬も美白と一緒に保湿もできると好評の商品です。\n\n◆敏感肌で、美白ケアをあきらめていた方にもおすすめ\n敏感肌の人こそシミができやすい、という事実に着目して作られたホワイトニングライン。\n肌に優しい使い心地で、「ゆらぎ肌を整える×根本美白」が叶います。\n\n◆美容保湿成分で肌をうるおいで満たし、透明美肌へ\n肌の土台にたっぷりうるおいを与えることで、美容サポート成分の届きやすい肌へ。\nINSERT INTO `item_category_rel` (`item_id`, `category_id`, `priority`, `created_at`, `created_by`, `updated_at`, `updated_by`)
