	('1pvwsLfDxcqc7eyAUEdtn5',1,'ビタミンCでアプローチ','一般的に酸化しやすい成分であるビタミンCの働きを最大限引き出し、シミを徹底予防。','2022-06-24 19:13:34','oidc|Perman|S16440','2022-06-24 19:13:34','oidc|Perman|S16440'),
	('1pvwsLfDxcqc7eyAUEdtn5',2,'5大添加物無添加','大切な肌のために防腐剤、香料、合成色素、石油系界面活性剤、紫外線吸収剤の添加なし。','2022-06-24 19:13:34','oidc|Perman|S16440','2022-06-24 19:13:34','oidc|Perman|S16440'),
