	('6LcMRX95YtohLdF89mOyR1','46605','','',1,NULL,0,'2022-06-24 12:00:00','2022-12-31 23:59:59','1,000円（税込）',NULL,5000,NULL,NULL,NULL,NULL,NULL,0,NULL,0,'【商品スペック】\n名称：つるつるマットベース\n通常価格：1,650円（税込）⇒特別価格：1,000円（税込）\n\n【キャンペーン内容】\n・ハーバー初めての方限定でつるつるマットベース（部分用化粧下地）13gを\n　通常価格1,650円のところを特別価格1,000円にてご提供。※おひとり様1本1回限り\n\n【つるつるマットベース概要】\n・一瞬で毛穴レス！ ※1\n・お肌をキュッと引き締め、化粧もちがアップ\n・毛穴をぼかして密着カバー\n・皮脂を吸着してサラッと肌が続く\n・ハーバー初めての方限定 送料無料 特別価格1,000円\n・使用感の満足度 90.9％ ※2\n\n【特徴説明】\n一瞬で毛穴レス！※1ひと塗りでつるんとカバーします。\n気になるマスクの化粧崩れにもおすすめ。使用感の満足度は90.9％です。※2\n\nたったひと塗りで小鼻や頬の気になる毛穴をひと塗りで隠してなめらかにしながらテカリを抑え、透明感あるつるつるマット肌に仕上げます。\n肌のひきしめ×皮脂の吸着で、マスクでも崩れず、テカリにくいサラサラ肌へ。\n\n＜毛穴の悩みに！ひと塗りでつるんとカバーする３つのポイント＞\n○お肌をキュッと引き締め、化粧もちアップ！\n○毛穴をぼかして密着カバー！\n○皮脂を吸着してサラッと肌がつづく！\n\n無添加主義※3のHABAだから、メイクもやさしさにこだわってミネラルカラーでつくられています。\nミネラルカラーの特徴\n・ナチュラルな仕上がり\n・素肌のままのような軽いつけ心地\n\nミネラルカラー参考URL\nhttps://www.haba.co.jp/f/h-005001008\n\n適量を手の甲に取り、毛穴の凸凹が気になる部分に少量ずつなじまてせてください。\n日やけ止めと全顔用化粧下地を併用する場合は、日やけ止め→つるつるマットベース→全顔用化粧下地の順にお使いください。\n使用後はクレンジングで落としてください。\n\n今ならハーバー初めての方限定で、送料無料 通常価格1,650円のところを特別価格1,000円にてご提供いたします。\n\n※1 メイクアップ効果による\n※2 2017年自社調べ(n=21)\n※3 防腐剤パラベン、石油系界面活性剤、合成香料、鉱物油、タール系色素は無添加','https://stat.amebaad.jp/ad/specialselect/amebapick/todo.png',2,'過去このサービス（商品）を利用したことがありますか？\nはい/いいえで教えてください。（※過去に利用したことがある場合でも、申込みが可能です。）','＜注釈が必要な表現＞\n一瞬で毛穴レス　→　※メイクアップ効果による\n一瞬でなめらかツルスベ肌　→　※メイクアップ効果による\n小鼻の毛穴悩みに　→　※メイクアップ効果による\n\n＜NG表現＞\n・✖続く、キープ：「毛穴レス続く」\n・✖マスクにつかずに　○マスクにつきにくい\n・毛穴を✖隠す、ぼかす　○カバー\n・密着カバーで化粧もち◎⇒部分下地ではないように捉えられる可能性があるためNG\n・✖「透明感」⇒部分用下地で色がつかないため、透明感を引き出す効果は薄いです。\n　　クリームに誤認される恐れも　化粧下地だとわかる表現にしていただきたいです。\n・✖化粧下地　〇部分用化粧下地\n・✖ツヤ　※つるつるマットベースの「マット」と「ツヤ」は逆となるため。\n・✖ツルすべ　〇つるすべ\n・✖毛穴ケア\n・✖無添加＝肌に負担がかからない　遠回しに他社誹謗ととらえてしまう可能性があるため。','・ご自身で撮影した写真を、1枚以上ブログに掲載してください。\n・商品やサービスについての感想や紹介を、最低3文以上を目安に掲載してください。\n・ハッシュタグに、必ず「#PR」をつけて投稿してください。\n・Ameba Pickのお知らせに発送通知が届いてから3週間以内に投稿を行ってください。\n・投稿した記事は、最低1年以上公開し、記事の削除はお控えください。\n\n※上記が守られない場合、報酬が反映されない、今後のスペシャルセレクト利用をお断りさせていただく場合がございます。','肌のひきしめ×皮脂の吸着でテカリのないサラサラ肌へ　HABAの部分用化粧下地',1,'【クローズド】つるつるマットベース_202206','2022-06-