	('86SXS5wwAvKrvqW2WVX4I4','44428','','',2,NULL,0,'2022-06-27 00:00:00','2022-12-31 23:59:59','1,430円（税込）',NULL,5000,NULL,NULL,NULL,NULL,NULL,0,NULL,0,'【商品スペック】\n名称：スクワラン美容おためしセット\n価格：1,430円（税込）\nセット内容：\n・高品位「スクワラン」(化粧オイル)　10mL ※おためしサイズ\n・薬用ホワイトレディ(薬用美白美容液※1)[医薬部外品]　8mL （使用量目安：薬用ホワイトレディ8mLは1回6プッシュ程度）\n・Gローション（化粧水）　30ｍL\n・スクワクレンジング（メイク落とし）　20mL\n※1 メラニンの生成を抑え、シミやソバカスを防ぐ\n\n【スクワラン商品概要】\nスクワラン100% 純度99.9%の美容オイル。\n（スクワラン：もともと皮脂に含まれていると言われているスクワレンを安定性が高く酸化されにくくしたもの。）\nこれ1本で乳液・クリームの変わりになる、肌を保護する美容オイル。\nたった一滴*1でOK。おためしサイズ1本で約2ヶ月分*2の容量。\n1983年の発売以来、38年のロングセラー商品。\n*1 使用量のこと\n*2 10mLサイズを朝晩1滴ずつ使用した場合\n\n【特徴】\n●しっとり・ぷるぷるの肌を保つ。\n●紫外線や空気の乾燥ダメージから肌を守る。\n●乾燥による小ジワを目立たなくする。効能評価試験済み*\n●オイルとは思えないサラサラ感（高純度ならでは）\n●酸化・変質しにくく、油やけもしにくい\n●全身に使用でき、ご家族でもご使用可。\n●防腐剤パラベン、石油系界面活性剤、合成香料、鉱物油、タール系色素は一切不使用。\n※効能評価試験済み、ノンコメドジェニックテスト済み(全ての方にコメド(ニキビのもと)が出来ないという事ではありません)アレルギーテスト済み（全ての方のアレルギーが起こらないという事ではありません）\n\n【実績】\n売上本数2,500万本突破※2004年3月～2020年8月までの出荷本数(15mLは1本・30mLは2本・60mLは4本・120mLは8本で換算した場合）\n「美的」読者が選ぶ2021年ベストコスメスキンケア部門オイル編第1位\n＠ｃｏｓｍｅベストコスメアワード2016 殿堂入り\n＠ｃｏｓｍｅベストコスメアワード2015 ベストオイル 第1位\n＠ｃｏｓｍｅベストコスメアワード2014 ベストオイル 第2位\nテキストで使用するのはNGです。\n美的であれば使用可。「美的」読者が選ぶベストコスメスキンケア部門2021年オイル編第1位　高品位「スクワラン」','https://stat.amebaad.jp/ad/specialselect/amebapick/todo.png',2,NULL,'【イラストブロガーの方限定】②③の訴求は、ぜひイラストと文言の両方でお伝え頂けますと幸いです。（写真も可能であればいれていただけますと幸いです。）        \n\n・本商品は「美容液」ではなく「美容オイル」になります。\n・「乾燥小じわ、乾燥、毛穴」という文言は使用可能ですが、「効果がある」「効く」といった表現はNGとなります。\n・「ほうれい線」はNGとなります、\n・商品名は【スクワラン】もしくは、【高品位「スクワラン」】で統一をお願いします。（高品位をつける場合は「」が必要になります。）              \n・競合社名・競合商品の記載はご遠慮下さい。\n・商材に対するネガティブな表現の記載はご遠慮下さい。\n・オイルは1回につき1滴の使用なので、必要以上にオイルを使用している描写はご遠慮下さい。','・ご自身で撮影した写真を、1枚以上ブログに掲載してください。\n・商品やサービスについての感想や紹介を、最低3文以上を目安に掲載してください。\n・ハッシュタグに、必ず「#PR」をつけて投稿してください。\n・Ameba Pickのお知らせに発送通知が届いてから3週間以内に投稿を行ってください。\n・投稿した記事は、最低1年以上公開し、記事の削除はお控えください。\n\n※上記が守られない場合、報酬が反映されない、今後のスペシャルセレクト利用をお断りさせていただく場合がございます。','1回1滴簡単ケア！HABAのスクワラン美容おためしセット',0,'【クローズド】スクワラン美容お試しセット_202206','2022-06-23 17:49:26','oidc|Perman|S09477','2022-06-23 17:49:26','oidc|Perman|S