	('a3umMEt2xYMPxBm0YzB6b5','45402','','',1,NULL,0,'2022-06-24 12:00:00','2022-12-31 23:59:59','1,600円（税込）※初回限定',NULL,2125,NULL,NULL,4900,'2022-12-31 23:59:59','2022-12-31 23:59:59',0,NULL,0,'＜製品特徴＞ \n肌のゆらぎによりバリア機能が低下することで発生する毛穴詰まりや繰り返しニキビを根本原因から予防し、ニキビのできにくい肌に導きます。\n ファンケル独自の6つの無添加(防腐剤・香料・合成色素・石油系界面活性剤・紫外線吸収剤・殺菌剤を不使用)処方。 \nニキビや毛穴悩みを根本原因からケアしてうるおいのあるなめらかな肌に整えます。\n\n◆「ゆさぶり因子」を新発見！繰り返しがちなニキビを防ぐ\nゆらぎがちな肌を根本から整え、ストレスに左右されない肌を目指します。\n◆「毛穴蓋」に着目！うるおいを保ち毛穴づまりを防ぐ\n「毛穴蓋」に着目したウメ果実エキスに加え、肌バリアをケアする漢植物エキスを配合。ニキビの発生を徹底的に防ぎます。\n◆肌の刺激をもらたす外的ストレスをケア\n「ケア」と「守り」の両面からダブルでアプローチします。\n \n▼サイトを詳しく見る \nhttps://www.fancl.co.jp/pub/acg/index_am_sp.html','https://stat.amebaad.jp/ad/specialselect/amebapick/todo.png',2,'過去このサービス（商品）を利用したことがありますか？\nはい/いいえで教えてください。（※過去に利用したことがある場合でも、申込みが可能です。）',NULL,'・ご自身で撮影した写真を、1枚以上ブログに掲載してください。\n・商品やサービスについての感想や紹介を、最低3文以上を目安に掲載してください。\n・ハッシュタグに、必ず「#PR」をつけて投稿してください。\n・Ameba Pickのお知らせに発送通知が届いてから3週間以内に投稿を行ってください。\n・投稿した記事は、最低1年以上公開し、記事の削除はお控えください。\n\n※上記が守られない場合、報酬が反映されない、今後のスペシャルセレクト利用をお断りさせていただく場合がございます。','大人ニキビ、もう繰り返さない。ファンケルのアクネケア。',1,'【手動】アクネケア薬用ニキビ1ヵ月集中セット【酵素洗顔パウダー付き】_202206','2022-06-24 11:47:27','oidc|Perman|S17673','2022-06-24 18:09:05','oidc|Perman|S09477'),
