	('D6z85NVyGob2kTkKHjdEYq','46948','','',1,NULL,0,'2022-06-24 12:00:00','2022-12-31 23:59:59','1,595円（税込）※定期初回価格',NULL,7200,NULL,NULL,8500,'2022-12-31 23:59:59','2022-12-31 23:59:59',0,NULL,0,'「ACNAL（アクナル）」は、学生時代からにきびに悩み続けていた開発者が、「自分の肌に自信を持てるようになりたい」という想いから開発をスタートしました。\n化粧品や肌について知識を深めていく中で、今までのにきびケアが間違っていたことに気づくとともに、何をしても治らないにきびの悪化要因は日中に多く集中していることがわかりました。\nそこで、日中のにきびの悪化要因を徹底的に追求し、「にきび悩みを解決に導く製品を世に届けたい」と開発担当者の等身大の悩みと共に製品化が実現しました。\n\n《炎症にきびをケアしながらしっかり落とすピンクオイル》\n■商品特徴\n1.ピンクオイルで洗う、洗顔＆クレンジング\n2.ウォータークッションオフ処方により、W洗顔不要\n3.スキンケアの浸透を高めるブースター効果\n4.ハーブオレンジの香りでリフレッシュ！ストレスまで一緒にオフ！\n\n初回限定3,190円が約50％OFFの1,595円になる特別キャンペーンを実施します。2回目以降もずっと20％OFFのとってもお得なキャンペーンです。','https://stat.amebaad.jp/ad/specialselect/amebapick/todo.png',2,'過去このサービス（商品）を利用したことがありますか？\nはい/いいえで教えてください。（※過去に利用したことがある場合でも、申込みが可能です。）',NULL,'・ご自身で撮影した写真を、1枚以上ブログに掲載してください。\n・商品やサービスについての感想や紹介を、最低3文以上を目安に掲載してください。\n・ハッシュタグに、必ず「#PR」をつけて投稿してください。\n・Ameba Pickのお知らせに発送通知が届いてから3週間以内に投稿を行ってください。\n・投稿した記事は、最低1年以上公開し、記事の削除はお控えください。\n\n※上記が守られない場合、報酬が反映されない、今後のスペシャルセレクト利用をお断りさせていただく場合がございます。','マナラからにきび悪化が進む日中に着目したケア商品が登場！にきび肌のための洗顔＆クレンジングです。',1,'【手動】アクナル　ピンクハーブクレンジング_202206','2022-06-24 19:00:49','oidc|Perman|S17673','2022-06-24 20:18:08','oidc|Perman|S09477'),
