	('E1QJb5BYYgIaNTOHcx5pu2','45315','','',2,NULL,0,'2022-06-24 12:00:00','2022-12-31 23:59:59','1,800円（税込）※初回限定',NULL,2125,NULL,NULL,4900,'2022-12-31 23:59:59','2022-12-31 23:59:59',0,NULL,0,'＜製品特徴＞\n大人気エイジングケア※がシワ改善機能をプラスしてパワーアップ。\n毎日のスキンケアで気になるシワを改善し、ふっくらハリに満ちた肌に整えます。\n今あるシワはもちろん、年齢サインが気になる目もと・口もとの表情シワにもアプローチし、\n弾力に満ちたハリ肌へ導きます。\n※エイジングケア=「年齢に応じたケア」を指します\n\n◆シワ改善有効成分で角質層までアプローチ\n・有効成分ナイアシンアミドが角質層に働きかけ、コラーゲンを産生しシワを改善。\n\n◆トリプルハリ肌成分がコラーゲンを産生して肌を満たす\n・「新鮮さ」「質」に加えて「スピード」にもこだわったトリプルケアで、\n　より素早く、質の良いコラーゲンを肌を満たします。\n・肌全体のハリ感をアップ。\n\n◆ダメージを受ける前と後に。肌本来の美しさを引き出す力がアップ\n・シソ葉エキスを新配合うるおいで乾燥や摩擦などの刺激から肌を守り、ストレスに負けない強い肌へ。','https://stat.amebaad.jp/ad/specialselect/amebapick/todo.png',2,'過去このサービス（商品）を利用したことがありますか？\nはい/いいえで教えてください。（※過去に利用したことがある場合でも、申込みが可能です。）','提携前に必ずご一読ください。\nリスティング出稿は禁止しております。\n無添加ワードを使う場合は、防腐剤・香料・合成色素・石油系界面活性剤・紫外線吸収剤を使っていない旨明記。\nその他、禁止事項は当ページに記載の項目をご確認ください。\n\n不正、及び禁止事項を行った媒体\n薬機法に抵触する可能性がある媒体\nその他、公序良俗に反する媒体\n上記媒体は提携解除とします\n\n■広告掲載における注意事項\n広告掲載の際は下記URLを必ず、ご確認頂き、\nガイドラインに沿った掲載をお願い致します。\n▼URL\n・ファンケル広告のガイドライン\nhttps://stat.amebaad.jp/ad/amebapick/fancl/cosme_202005.pdf\n\n※ガイドラインに則してないと判断した場合は、修正及び提携解除の対象となりますのでご注意下さいませ。\n健全な広告運用へのご協力をお願い申し上げます。','・ご自身で撮影した写真を、1枚以上ブログに掲載してください。\n・商品やサービスについての感想や紹介を、最低3文以上を目安に掲載してください。\n・ハッシュタグに、必ず「#PR」をつけて投稿してください。\n・Ameba Pickのお知らせに発送通知が届いてから3週間以内に投稿を行ってください。\n・投稿した記事は、最低1年以上公開し、記事の削除はお控えください。\n\n※上記が守られない場合、報酬が反映されない、今後のスペシャルセレクト利用をお断りさせていただく場合がございます。','毎日のスキンケアでシワ改善、ファンケルのエンリッチプラス誕生',1,'※削除※エンリッチプラスシワ改善1ヵ月集中セット【美容液・酵素洗顔付き】_202206','2022-06-24 12:31:35','oidc|Perman|S17673','2022-06-24 20:59:13','oidc|Perman|S09477'),
