	('pPuSraBWumVYizdLFGWRN6','47286','','',2,NULL,0,'2022-06-24 12:00:00','2022-12-31 23:59:59','①11,000円（税込）、②17,050円（税込）、③11,000円（税込）',15,NULL,NULL,NULL,NULL,NULL,NULL,1,'10％オフクーポン',1,'①EVER BRILLIANCE / 0.3カラット 6爪ソリティアリング【tf6839r】      \nシンプルで品のある作りが好評の0.3カラット一粒リング。長く愛される6本爪で普段使いしやすい高さを抑えたデザインです。\n【商品URL】https://www.jewelrycastle.jp/view/item/000000000376  \n【販売価格】11,000円（税込）\n【商品詳細】\n・ストーン：EVER BRILLIANCEカットジルコニア 0.3カラット（4.5mm・ラウンドブリリアントカット）\nEVER BRILLIANCEカットにつきましてはこちらでご確認いただけます。\nhttps://www.jewelrycastle.jp/view/page/everbrilliancecut\n・素材：シルバー925にプラチナ又は18金仕上※2カラー\n　　　　リングサイズ：6号~15号（1号刻み）\n\n程よいサイズ感で、デイリーから手先に美しい輝きの色どりを添える飽きのこないシンプルな一粒リング♪\n流行り廃りのない６本爪のデザインを高さを抑えた普段使いにもとっても使いやすいデザインにてお作りいたしました。\nストーンには、4.5mm（0.3カラット相当）のEVER BRILLIANCEカットジルコニアを使用しておりますので、上質なダイヤモンドに近い輝きをいつでもお楽しみいただけます。\n\n②EVER BRILLIANCE / クロスラインハーフエタニティーリング【tf633r】\nクロスしたデザインが指を細く・長く見せる嬉しい効果があり、ハーフエタニティーのシンプルエレガントな雰囲気も醸し出すリングです。\n【商品URL】https://www.jewelrycastle.jp/view/item/000000000031\n【販売価格】17,050円（税込）\n【商品詳細】\nストーン：EVER BRILLIANCEカットジルコニア トータルカラット：0.21カラット\n素材：シルバー925にプラチナ又は18金仕上※2カラー\nリングサイズ：6号~18号（1号刻み）\n\n緩やかにカーブを描いた２本のラインがクロスする高いデザイン性と、程よいボリューム感が人気の、デザイナーズリング。１４石の光り輝くEVER BRILLIANCEカットジルコニアがさり気ないゴージャス感もアピールいたします。\n\n③EVER BRILLIANCE / 流線型が美しい 0.3カラットデザイナーズリング【tf6890r】\n爪を使わない石留めが日常使いで引っ掛かりなどがなく使いやすい一粒のシンプルなリングです。       \n【商品URL】https://www.jewelrycastle.jp/view/item/000000000023  \n【販売価格】11,000円（税込）\n【商品詳細】\nストーン：EVER BRILLIANCEカットジルコニア 0.3カラット（4.5mm・ラウンドブリリアントカット）\n素材：シルバー925にプラチナ又は18金仕上※2カラー\nリングサイズ：6号~15号（1号刻み）\n\n日常のあらゆる装いにも特別な装いにもすっと馴染む緩やかな美しい流れの中に上質な輝き♪\n0.3ct(4.5mm)のEVER BRILLIANCEカットジルコニアが手元に彩りを添えるシンプルなデザイナーズリング。','1.申込後、Ameba Pickお知らせでご連絡させていただく専用クーポンコードを使い、ご自身で対象アイテムをご購入\n2.アイテムを実際に体験いただき、Ameba Pickの機能を使って対象アイテムの紹介記事を執筆・ご投稿\n\n※クーポンコードの金額を超えるご注文はご自身でご負担いただきます。\n※Ameba Pickについてはこちら(https://content.ameba.jp/ameba_pick/start/ )をご確認ください。\n※商品に関するwebページへの転載・広告バナーでの2次利用に対するご同意をお願いいたします。なお、2次利用が発生する場合は、事前に確認のご連絡をさせていただきます。\n※過去に本アイテムをお取り寄せいただいたことがある場合、前回の記事と同じものを使いまわすのはお控えください。\n発覚