	('z6gzeE5p7qdhu8FJTn7rH1','46192','','',1,NULL,0,'2022-06-24 12:00:00','2022-12-31 23:59:59','無料',NULL,675,NULL,NULL,NULL,NULL,NULL,0,NULL,1,'ディズニー英語システムの無料サンプルは「無料なのにこんなにもらっていいの？」と感じるくらい充実したラインナップです。サンプルDVDにサンプルCD、歌の絵本、Wチャンスで「お風呂でABCポスター」も付いてきます！\n子どもが気に入ってくれるかどうかって実際使ってみないとわからないですし、こうして試すことができるのって、親としては本当に安心ですよね。\nハーバード大学修士の言語学と言語教育の権威、アン・R・ダウ氏らにより、言語学はもちろん子どもの発達心理学も研究して開発されたディズニー英語システムをまずは無料サンプルでお試しください。\nさらに、お風呂が楽しくなるポスターのプレゼントまでついていて絶対お得です。\nぜひ、この機会に応募してみてください！','https://stat.amebaad.jp/ad/specialselect/amebapick/todo.png',2,'サンプリング希望の商品を下記4種類からお選びいただき、下記フォームよりご回答ください。\n①0歳児用\n②1歳児用\n③2~3歳児用\n④4歳児用','ワールド・ファミリー　→　「・(ナカグロ)」必須\nDWE　→ ディズニー英語システムの略。大文字表記:Disney World of English\n\n■その他1 ＜DWEと結びつけて英語の文言を使用する際の留意点＞\nDWEは、お勉強、学習という固いイメージではなく、楽しく自然なかたちで英語を身につけられることを訴求したいため、DWEと英語の文言を結びつける場合は、「英語を学ぶ」「英語を学習する」等の表現ではなく、\n「英語を習得する」「英語を身につける」等の表現を用いるようにしてください。\n\n■その他2 ＜無料サンプルプレゼントに関する表記の留意点①＞\n無料サンプルは希望した方がもらえるものですが、再請求（以前すでにサンプルをもらったことがある）の場合には、原則、無料サンプルはもらえません。（無料サンプル告知部分では、本内容に関する※注記を常時表記しています）そのため、「誰でも全員がもらえる」といった誤認を避けるために、下記例のような表記としてください。\nex.)\n○　希望された方に無料サンプルをプレゼント！\n×　無料サンプルを全員プレゼント！\n×　希望された方全員に無料サンプルをプレゼント！','・ご自身で撮影した写真を、1枚以上ブログに掲載してください。\n・商品やサービスについての感想や紹介を、最低3文以上を目安に掲載してください。\n・ハッシュタグに、必ず「#PR」をつけて投稿してください。\n・Ameba Pickのお知らせに発送通知が届いてから3週間以内に投稿を行ってください。\n・投稿した記事は、最低1年以上公開し、記事の削除はお控えください。\n\n※上記が守られない場合、報酬が反映されない、今後のスペシャルセレクト利用をお断りさせていただく場合がございます。','子どもに「一生ものの英語力」を！ディズニー英語システムの無料サンプルをプレゼント！',1,'【手動】ディズニー英語システム_202206','2022-06-23 13:13:53','oidc|Perman|S09477','2022-06-24 17:57:03','oidc|Perman|S13797');

